var findTheDifference = function(s, t) {
  // 배열로 변환 후 정렬
  let sortedS = s.split('').sort();
  let sortedT = t.split('').sort();
  // 알파벳 갯수만큼 반복
  for (let i = 97; i <= 122; i++) {
    // 문자로 변환
    let char = String.fromCharCode([i]);
    // 요소 갯수
    let lenthS = sortedS.lastIndexOf(char);
    let lenthT = sortedT.lastIndexOf(char);
    // 다르면 반환 
    if (lenthS !== lenthT)
      return char;
  }
};